import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaSearch, FaExternalLinkAlt } from 'react-icons/fa';

const Projects = () => {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true,
  });

  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: "Modern Office Complex",
      category: "commercial",
      location: "Downtown Business District",
      year: "2024",
      description: "A state-of-the-art office complex featuring sustainable design and modern amenities.",
      image: "ðŸ¢",
      stats: { area: "25,000 sq ft", duration: "18 months", budget: "$15M" }
    },
    {
      id: 2,
      title: "Luxury Residential Tower",
      category: "residential",
      location: "Waterfront District",
      year: "2023",
      description: "Premium residential development with panoramic views and luxury amenities.",
      image: "ðŸ ",
      stats: { area: "150 units", duration: "24 months", budget: "$45M" }
    },
    {
      id: 3,
      title: "Industrial Manufacturing Plant",
      category: "industrial",
      location: "Industrial Zone",
      year: "2023",
      description: "Advanced manufacturing facility designed for efficiency and sustainability.",
      image: "ðŸ­",
      stats: { area: "50,000 sq ft", duration: "12 months", budget: "$30M" }
    },
    {
      id: 4,
      title: "Shopping Center Renovation",
      category: "commercial",
      location: "Suburban Mall",
      year: "2023",
      description: "Complete renovation and modernization of existing retail space.",
      image: "ðŸ›ï¸",
      stats: { area: "100,000 sq ft", duration: "8 months", budget: "$20M" }
    },
    {
      id: 5,
      title: "Eco-Friendly Community",
      category: "residential",
      location: "Green Valley",
      year: "2022",
      description: "Sustainable residential community with green building practices.",
      image: "ðŸŒ±",
      stats: { area: "200 homes", duration: "36 months", budget: "$60M" }
    },
    {
      id: 6,
      title: "Smart Warehouse Facility",
      category: "industrial",
      location: "Logistics Hub",
      year: "2022",
      description: "Automated warehouse with cutting-edge technology and robotics.",
      image: "ðŸ“¦",
      stats: { area: "75,000 sq ft", duration: "15 months", budget: "$35M" }
    }
  ];

  const filters = [
    { key: 'all', label: 'All Projects' },
    { key: 'commercial', label: 'Commercial' },
    { key: 'residential', label: 'Residential' },
    { key: 'industrial', label: 'Industrial' }
  ];

  const filteredProjects = projects.filter(project => 
    activeFilter === 'all' || project.category === activeFilter
  );

  return (
    <section id="projects" className="section-padding bg-gray-50">
      <div className="container-custom">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-display font-bold text-gray-900 mb-6">
            Our <span className="text-gradient">Projects</span>
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Explore our portfolio of successful projects that showcase our expertise 
            in construction and architectural design.
          </p>
        </motion.div>

        {/* Filter Buttons */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6, delay: 0.2 }}
          className="flex flex-wrap justify-center gap-4 mb-12"
        >
          {filters.map((filter) => (
            <motion.button
              key={filter.key}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              onClick={() => setActiveFilter(filter.key)}
              className={`px-6 py-3 rounded-lg font-medium transition-all duration-300 ${
                activeFilter === filter.key
                  ? 'bg-primary-600 text-white shadow-lg'
                  : 'bg-white text-gray-700 hover:bg-primary-50 border border-gray-200'
              }`}
            >
              {filter.label}
            </motion.button>
          ))}
        </motion.div>

        {/* Projects Grid */}
        <AnimatePresence mode="wait">
          <motion.div
            key={activeFilter}
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -30 }}
            transition={{ duration: 0.5 }}
            className="grid md:grid-cols-2 lg:grid-cols-3 gap-8"
          >
            {filteredProjects.map((project, index) => (
              <motion.div
                key={project.id}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                whileHover={{ y: -10 }}
                className="bg-white rounded-2xl shadow-lg hover:shadow-2xl transition-all duration-300 overflow-hidden group"
              >
                {/* Project Image */}
                <div className="relative h-64 bg-gradient-to-br from-primary-600 to-primary-800 flex items-center justify-center">
                  <div className="text-6xl">{project.image}</div>
                  <div className="absolute inset-0 bg-black/20 group-hover:bg-black/30 transition-all duration-300"></div>

                  {/* Overlay */}
                  <div className="absolute inset-0 flex items-center justify-center opacity-0 group-hover:opacity-100 transition-all duration-300">
                    <motion.button
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.9 }}
                      className="bg-white/90 text-primary-600 p-3 rounded-full"
                    >
                      <FaSearch className="text-xl" />
                    </motion.button>
                  </div>

                  {/* Category Badge */}
                  <div className="absolute top-4 left-4">
                    <span className="bg-white/90 text-primary-600 px-3 py-1 rounded-full text-sm font-medium">
                      {project.category.charAt(0).toUpperCase() + project.category.slice(1)}
                    </span>
                  </div>
                </div>

                {/* Project Info */}
                <div className="p-6">
                  <div className="flex items-center justify-between mb-3">
                    <h3 className="text-xl font-display font-bold text-gray-900">
                      {project.title}
                    </h3>
                    <motion.button
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.9 }}
                      className="text-primary-600 hover:text-primary-700 transition-colors duration-300"
                    >
                      <FaExternalLinkAlt />
                    </motion.button>
                  </div>

                  <p className="text-gray-600 mb-4 leading-relaxed">
                    {project.description}
                  </p>

                  <div className="flex items-center justify-between text-sm text-gray-500 mb-4">
                    <span>{project.location}</span>
                    <span>{project.year}</span>
                  </div>

                  {/* Project Stats */}
                  <div className="grid grid-cols-3 gap-4 pt-4 border-t border-gray-100">
                    <div className="text-center">
                      <div className="text-lg font-bold text-primary-600">{project.stats.area}</div>
                      <div className="text-xs text-gray-500">Area</div>
                    </div>
                    <div className="text-center">
                      <div className="text-lg font-bold text-primary-600">{project.stats.duration}</div>
                      <div className="text-xs text-gray-500">Duration</div>
                    </div>
                    <div className="text-center">
                      <div className="text-lg font-bold text-primary-600">{project.stats.budget}</div>
                      <div className="text-xs text-gray-500">Budget</div>
                    </div>
                  </div>
                </div>
              </motion.div>
            ))}
          </motion.div>
        </AnimatePresence>

        {/* View All Projects CTA */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.8 }}
          className="text-center mt-16"
        >
          <div className="bg-white rounded-2xl shadow-lg p-8 md:p-12">
            <h3 className="text-3xl font-display font-bold text-gray-900 mb-4">
              Want to See More?
            </h3>
            <p className="text-lg text-gray-600 mb-8 max-w-2xl mx-auto">
              Our portfolio includes hundreds of successful projects across various sectors. 
              Let us show you how we can bring your vision to life.
            </p>
            <motion.button
